'''Elegant costumes''' (also known as '''Ele' costumes''') are formal fancy clothing that come in sets of different colours (red, blue, green, purple, white and black) and in male and female varieties. These costumes are obtained as rewards from Easy to Medium [[Treasure Trails]]. A full costume set can be stored in the [[Costume room]] of a [[Player-owned house]].

The red, green, and blue costumes can be obtained from [[Clue scroll (easy)|easy Treasure Trails]], and the purple, gold, white, and black costumes from [[Clue scroll (medium)|medium Treasure Trails]]. As some of the costume colours may be desired more than others, the prices vary between each costume colour, sometimes greatly. The male/female factor also influences the prices between the costumes.

Note that the White elegant costume is only available in the female design, while the Black elegant costume is only available in the male design. However, any of the costumes may be worn regardless of the player's gender.

